  false,\n\t\"url\": null,\n\t\"notes\": \"nThese data were collected by the U.S.
  Bureau of Land Management (BLM) in New Mexico at both the New Mexico State Office
  and at the various field offices. This dataset is meant to depict the federal mineral
  (or subsurface) interest of land parcels within New Mexico. Nonattempt is made to
  depict the mineral interest of non-federal entities. BLM's Master TitlenPlats are
  the official land records of the federal government and serve as the primary datansource
  for depiction of federal mineral interest lands. Auxilliary source are referenced,
  asnwell, for the depiction of federal mineral interest. Collection of this dataset
  began in then1980's using the BLM's ADS software to digitize information at the
  1:24,000 scale. In thenmid to late 1990's the data was converted from ADS to ArcInfo
  software and merged into tilesnof one degree of longitude by one half degree of
  latitude. These tiles were regularlynupdated. The tiles were merged into a statewide
  coverage. The source geodatabase for thisnshapefile was created by loading the merged
  ArcInfo coverage into a personal geodatabase.nThe geodatabase data were snapped
  to a more accurate GCDB derived land network, wherenavailable. In areas where GCDB
  was not available the data were snapped to digitized PLSS.nThis shapefile has been
  created by exporting the geodatabase feature class.n\",\n\t\"license_title\": null,\n\t\"extras\":
